value.value:
linear-gradient(
      to bottom right,
      var(--ak-aurora-color-1),
      transparent,
      transparent,
      var(--ak-aurora-color-2, transparent),
      transparent,
      transparent,
      var(--ak-aurora-color-1)
    )

properties.value:
oklch(
    from var(--ak-layer)
      clamp(
        var(--ak-button-min-l),
        var(--ak-button-bg-dark-l),
        var(--ak-button-max-l)
      )
      c h
  )

oklch(
    from var(--ak-layer)
      clamp(
        var(--ak-button-min-l),
        var(--ak-button-bg-light-l),
        var(--ak-button-max-l)
      )
      c h
  )

oklch(
    from var(--ak-button-bg-dark) calc(l - 0.15) c h
  )

oklch(
    from var(--ak-button-bg-dark) calc(l + 0.02) c h
  )

value.value:
oklch(
      from var(--ak-button-bg-dark) calc(l - 0.02) c h
    )

properties.value:
conic-gradient(
    from 0deg,
    var(--ak-layer) 0turn,
    var(--ak-layer) calc(var(--ak-progress-value) * 1turn - var(--feather-deg)),
    transparent calc(var(--ak-progress-value) * 1turn + var(--feather-deg)),
    transparent 1turn
  )

value.value:
calc(
      100% + max(0px, var(--ak-list-gap)) +
        max(var(--ak-list-gap), var(--ak-frame-padding)) -
        var(--ak-list-border-gap) - var(--ak-list-border-top)
    )
